import React from 'react';
import Posts from '../../components/Posts';
import PagePagination from '../../components/PagePagination';
import { withPostConsumer } from "../../context";

const Home = () => {
	return (
		<React.Fragment>
			<Posts/>
			<PagePagination />
		</React.Fragment>
	)
}

export default withPostConsumer(Home)
